import React from 'react';
import NewExpense from './components/NewExpense/NewExpense';
import Expense from "./components/Expenses/Expense";

const App = () => {
   let expense = [
     {
       id: "1",
       date: new Date(2023, 6, 24),
       Title: "School Fee",
       Amount: 300,
     },
     {
       id: "2",
       date: new Date(2023, 6, 24),
       Title: "Book",
       Amount: 785,
     },
     {
       id: "3",
       date: new Date(2023, 6, 24),
       Title: "Shop",
       Amount: 654,
     },
     {
       id: "4",
       date: new Date(2023, 6, 24),
       Title: "Food",
       Amount: 540,
     },
   ];

   return (
     <div>
        <NewExpense />
       <Expense item={expense} />
     </div>
   );
 }

export default App;
